import React from "react";
import "./Producto.css";
const Producto = (props) => {
  return (
    <div className="producto">
      <div className="col-md-4">
        {props.producto.nombre}
        <button className="btn btn-primary">Comprar</button>
      </div>
    </div>
  );
};
export default Producto;
